import React from "react";
import Chart from "../Chart/Chart";

const ExpensesChart = props => {
    const chartDataPoints = [
        {lable: 'Jan', value: 0 },
        {lable: 'Feb', value: 0 },
        {lable: 'Mar', value: 0 },
        {lable: 'Apr', value: 0 },
        {lable: 'May', value: 0 },
        {lable: 'June', value: 0 },
        {lable: 'July', value: 0 },
        {lable: 'Augu', value: 0 },
        {lable: 'Jan', value: 0 },
    ]
}

export default ExpensesChart;
